Másters Surf Reunion
 ✨ENCUENTRO✨

Súper agradecido con la gente linda de RD en Playa Encuentro! Desde los locales, gente de todos lados del mundo y mis panas venezolanos, que lugar tan especial tienen, cuídenlo! ✨💖

Gratificante Victoria en esta 7ma. Edición del @masterssurfreunionrd Clase de evento, altas vibras y trato a los competidores! ✨🙏🏽💫

Siempre es un placer y honor trabajar con mi coach @heribertotinoco, según él, ya son 23 años de amistad! Feliz de que te haya gustado el regalo de cumpleaños coach. 🤪🤩😘

A mi familia y compañías que me apoya, siempre agradecido ✨🙏🏽💫💖

